from typing import List

class Solution:
    def sumDigitDifferences(self, nums: List[int]) -> int:
        m = len(str(nums[0]))
        sm = 0 
        n = len(nums)
        for _ in range(m):
            c = [0]*10
            for i,a in enumerate(nums):
                nums[i],t = divmod(a,10)
                c[t] +=1 
            sm += sum(v *(n-v) for v in c)//2
        return sm

